{
  "openapi": "3.0.1",
  "info": {
    "title": "Settings Management",
    "description": "Settings Management API"
  },
  "servers": [
    {
      "url": "https://marketplace.walmartapis.com",
      "description": "Production URL"
    },
    {
      "url": "https://sandbox.walmartapis.com",
      "description": "Sandbox URL"
    }
  ],
  "security": [
    {
      "basicScheme": []
    }
  ],
  "paths": {
    "/v3/settings/shipping/3plshipnodes": {
      "post": {
        "tags": [
          "Settings"
        ],
        "summary": "Create third party fulfillment center",
        "description": "This API creates a third party fulfillment center.",
        "operationId": "create3PFulfillmentCenter",
        "parameters": [
          {
            "in": "header",
            "name": "Authorization",
            "description": "Basic authorization header. Base 64 encodes the Client ID and Client Secret retrieved in step two of the integration steps.",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "Basic YzcyOTFjNmItNzI5MC00...."
          },
          {
            "in": "header",
            "name": "WM_SEC.ACCESS_TOKEN",
            "description": "The access token retrieved in the Token API call",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "eyJraWQiOiIzZjVhYTFmNS1hYWE5LTQzM....."
          },
          {
            "in": "header",
            "name": "WM_CONSUMER.CHANNEL.TYPE",
            "description": "A unique ID to track the consumer request by channel. Use the Consumer Channel Type received during onboarding",
            "required": false,
            "schema": {
              "type": "string"
            }
          },
          {
            "in": "header",
            "name": "WM_QOS.CORRELATION_ID",
            "description": "A unique ID which identifies each API call and used to track and debug issues; use a random generated GUID for this ID",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "b3261d2d-028a-4ef7-8602-633c23200af6"
          },
          {
            "in": "header",
            "name": "WM_SVC.NAME",
            "description": "Walmart Service Name",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "Walmart Service Name"
          }
        ],
        "requestBody": {
          "description": "Request fields",
          "content": {
            "application/json": {
              "schema": {
                "type": "object",
                "properties": {
                  "shipNodeHeader": {
                    "type": "object",
                    "properties": {
                      "version": {
                        "type": "string"
                      }
                    }
                  },
                  "shipNode": {
                    "type": "array",
                    "items": {
                      "type": "object",
                      "properties": {
                        "shipNode": {
                          "type": "string",
                          "description": "The fulfillment center or ship node which uniquely identifies each facility and is retrieved from the Get all third party fulfillment providers API."
                        },
                        "status": {
                          "type": "string",
                          "description": "Status of fulfillment center. Allowed values: ACTIVE, INACTIVE."
                        }
                      }
                    }
                  }
                }
              },
              "example": {
                "shipNodeHeader": {
                  "version": "1.2"
                },
                "shipNode": [
                  {
                    "shipNode": "99351656957153281",
                    "status": "ACTIVE"
                  }
                ]
              }
            }
          },
          "required": true
        },
        "responses": {
          "200": {
            "description": "Successful Operation",
            "content": {
              "application/json": {
                "schema": {
                  "type": "array",
                  "items": {
                    "type": "object",
                    "properties": {
                      "shipNode": {
                        "type": "string",
                        "description": "The fulfillment center or ship node which uniquely identifies each facility and is retrieved from the Get all third party fulfillment providers API."
                      },
                      "status": {
                        "type": "string",
                        "description": "Status of fulfillment center. Allowed values: ACTIVE, INACTIVE."
                      }
                    }
                  }
                },
                "example": [
                  {
                    "shipNode": "99351656957153281",
                    "status": "ACTIVE"
                  }
                ]
              }
            }
          }
        }
      }
    },
    "/v3/settings/shipping/carriers": {
      "get": {
        "tags": [
          "Settings"
        ],
        "summary": "Get carrier methods",
        "description": "Gets the available carrier methods",
        "operationId": "getCarrierMethods",
        "parameters": [
          {
            "in": "header",
            "name": "Authorization",
            "description": "Basic authorization header. Base 64 encodes the Client ID and Client Secret retrieved in step two of the integration steps.",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "Basic YzcyOTFjNmItNzI5MC00...."
          },
          {
            "in": "header",
            "name": "WM_SEC.ACCESS_TOKEN",
            "description": "The access token retrieved in the Token API call",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "eyJraWQiOiIzZjVhYTFmNS1hYWE5LTQzM....."
          },
          {
            "in": "header",
            "name": "WM_CONSUMER.CHANNEL.TYPE",
            "description": "A unique ID to track the consumer request by channel. Use the Consumer Channel Type received during onboarding",
            "required": false,
            "schema": {
              "type": "string"
            }
          },
          {
            "in": "header",
            "name": "WM_QOS.CORRELATION_ID",
            "description": "A unique ID which identifies each API call and used to track and debug issues; use a random generated GUID for this ID",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "b3261d2d-028a-4ef7-8602-633c23200af6"
          },
          {
            "in": "header",
            "name": "WM_SVC.NAME",
            "description": "Walmart Service Name",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "Walmart Service Name"
          }
        ],
        "responses": {
          "200": {
            "description": "Successful Operation",
            "content": {
              "application/json": {
                "schema": {
                  "type": "array",
                  "items": {
                    "type": "object",
                    "properties": {
                      "carrierMethodId": {
                        "type": "string",
                        "description": "Carrier Id"
                      },
                      "carrierMethodName": {
                        "type": "string",
                        "description": "Carrier Name"
                      },
                      "carrierMethodType": {
                        "type": "string",
                        "description": "Shipping method. Allowed Value is GROUND."
                      },
                      "carrierMethodDescription": {
                        "type": "string",
                        "description": "A description for the method carrier."
                      }
                    }
                  }
                },
                "example": [
                  {
                    "carrierMethodId": "1000014",
                    "carrierMethodName": "USPS",
                    "carrierMethodType": "GROUND",
                    "carrierMethodDescription": "USPS for Marketplace"
                  },
                  {
                    "carrierMethodId": "1000013",
                    "carrierMethodName": "UPS",
                    "carrierMethodType": "GROUND",
                    "carrierMethodDescription": "UPS for Marketplace"
                  },
                  {
                    "carrierMethodId": "1000012",
                    "carrierMethodName": "FEDEX",
                    "carrierMethodType": "GROUND",
                    "carrierMethodDescription": "Fedex for Marketplace"
                  }
                ]
              }
            }
          }
        }
      }
    },
    "/v3/settings/shipping/shipnodes/coverage": {
      "get": {
        "tags": [
          "Settings"
        ],
        "summary": "Get coverage for fulfillment centers",
        "description": "This API provides the list of all fullfillment centers for the seller and their coverage areas defined by Walmart based on the address",
        "operationId": "getCoverageForFulfillmentCenters",
        "parameters": [
          {
            "in": "header",
            "name": "Authorization",
            "description": "Basic authorization header. Base 64 encodes the Client ID and Client Secret retrieved in step two of the integration steps.",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "Basic YzcyOTFjNmItNzI5MC00...."
          },
          {
            "in": "header",
            "name": "WM_SEC.ACCESS_TOKEN",
            "description": "The access token retrieved in the Token API call",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "eyJraWQiOiIzZjVhYTFmNS1hYWE5LTQzM....."
          },
          {
            "in": "header",
            "name": "WM_CONSUMER.CHANNEL.TYPE",
            "description": "A unique ID to track the consumer request by channel. Use the Consumer Channel Type received during onboarding",
            "required": false,
            "schema": {
              "type": "string"
            }
          },
          {
            "in": "header",
            "name": "WM_QOS.CORRELATION_ID",
            "description": "A unique ID which identifies each API call and used to track and debug issues; use a random generated GUID for this ID",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "b3261d2d-028a-4ef7-8602-633c23200af6"
          },
          {
            "in": "header",
            "name": "WM_SVC.NAME",
            "description": "Walmart Service Name",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "Walmart Service Name"
          }
        ],
        "responses": {
          "200": {
            "description": "Successful Operation",
            "content": {
              "application/json": {
                "schema": {
                  "type": "array",
                  "items": {
                    "type": "object",
                    "properties": {
                      "shipNode": {
                        "type": "string",
                        "description": "The fulfillment center or ship node Id which uniquely identifies each facility and is autogenerated during the creation of fulfillment center. Every time a facility is added, a new ship node id is generated."
                      },
                      "shipNodeName": {
                        "type": "string",
                        "description": "Name of the fulfillment center."
                      },
                      "coverageArea": {
                        "type": "array",
                        "description": "Two day shipping regions defined by Walmart for sellers.",
                        "items": {
                          "type": "string",
                          "description": "Two day shipping regions defined by Walmart for sellers."
                        }
                      }
                    }
                  }
                },
                "example": [
                  {
                    "shipNode": "81087939095695361",
                    "shipNodeName": "Seller test-distributor1",
                    "coverageArea": []
                  },
                  {
                    "shipNode": "79112975786049537",
                    "shipNodeName": "Seller test-distributor2",
                    "coverageArea": [
                      "AR1",
                      "AR2",
                      "CA1",
                      "AR3",
                      "PA4",
                      "CA3",
                      "CA2"
                    ]
                  },
                  {
                    "shipNode": "79114105970622465",
                    "shipNodeName": "Seller test-distributor3",
                    "coverageArea": [
                      "PA2",
                      "PA1",
                      "NY1"
                    ]
                  },
                  {
                    "shipNode": "80359164518989825",
                    "shipNodeName": "Seller test-distributor4",
                    "coverageArea": []
                  }
                ]
              }
            }
          }
        }
      }
    },
    "/v3/settings/shipping/shipnodes": {
      "get": {
        "tags": [
          "Settings"
        ],
        "summary": "Get all fulfillment centers",
        "description": "This API provides a list of all the fulfillment centers",
        "operationId": "getAllFulfillmentCenters",
        "parameters": [
          {
            "name": "includeCalendarDayConfiguration",
            "in": "query",
            "description": "Flag to specify if calendarDayConfiguration block will be included in the response. Allowed values are true or false.",
            "required": false,
            "schema": {
              "type": "boolean",
              "default": false
            }
          },
          {
            "in": "header",
            "name": "Authorization",
            "description": "Basic authorization header. Base 64 encodes the Client ID and Client Secret retrieved in step two of the integration steps.",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "Basic YzcyOTFjNmItNzI5MC00...."
          },
          {
            "in": "header",
            "name": "WM_SEC.ACCESS_TOKEN",
            "description": "The access token retrieved in the Token API call",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "eyJraWQiOiIzZjVhYTFmNS1hYWE5LTQzM....."
          },
          {
            "in": "header",
            "name": "WM_CONSUMER.CHANNEL.TYPE",
            "description": "A unique ID to track the consumer request by channel. Use the Consumer Channel Type received during onboarding",
            "required": false,
            "schema": {
              "type": "string"
            }
          },
          {
            "in": "header",
            "name": "WM_QOS.CORRELATION_ID",
            "description": "A unique ID which identifies each API call and used to track and debug issues; use a random generated GUID for this ID",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "b3261d2d-028a-4ef7-8602-633c23200af6"
          },
          {
            "in": "header",
            "name": "WM_SVC.NAME",
            "description": "Walmart Service Name",
            "required": true,
            "schema": {
              "type": "string"
            },
            "example": "Walmart Service Name"
          }
        ],
        "responses": {
          "200": {
            "description": "Successful Operation",
            "content": {
              "application/json": {
                "schema": {
                  "type": "array",
                  "items": {
                    "type": "object",
                    "properties": {
                      "shipNode": {
                        "type": "string",
                        "description": "The fulfillment center or ship node Id which uniquely identifies each facility and is autogenerated during the creation of fulfillment center. Every time a facility is added, a new ship node id is generated."
                      },
                      "nodeType": {
                        "type": "string",
                        "description": "Defines if the fulfillment center is virtual, seller owned or third party owned. Allowed values: PHYSICAL, VIRTUAL, 3PL."
                      },
                      "shipNodeName": {
                        "type": "string",
                        "description": "Name of the fulfillment center."
                      },
                      "status": {
                        "type": "string",
                        "description": "Status of fulfillment center. Allowed values: ACTIVE, INACTIVE.."
                      },
                      "timeZone": {
                        "type": "string",
                        "description": "Time zone that the seller ships from.Allowed timezones are PST, EST, CST, MST."
                      },
                      "distributorSupportedServices": {
                        "type": "array",
                        "description": "The services supported by the defined physical ship node . The allowed values: TWO_DAY_DELIVERY.",
                        "items": {
                          "type": "string",
                          "description": "The services supported by the defined physical ship node . The allowed values: TWO_DAY_DELIVERY."
                        }
                      },
                      "customNodeId": {
                        "type": "string",
                        "description": "Custom node identifier provided by seller. Allowed values are alphanumeric | String"
                      },
                      "postalAddress": {
                        "type": "object",
                        "properties": {
                          "addressLine1": {
                            "type": "string",
                            "description": "Street address of the fulfillment center."
                          },
                          "city": {
                            "type": "string",
                            "description": "City of the fulfillment center."
                          },
                          "state": {
                            "type": "string",
                            "description": "State of the fulfillment center."
                          },
                          "country": {
                            "type": "string",
                            "description": "Country of the fulfillment center."
                          },
                          "postalCode": {
                            "type": "string",
                            "description": "Postal code of the fulfillment center."
                          }
                        },
                        "description": "Postal code of the fulfillment center."
                      },
                      "shippingDetails": {
                        "type": "array",
                        "description": "Shipping Details.",
                        "items": {
                          "type": "object",
                          "properties": {
                            "twoDayShipping": {
                              "type": "array",
                              "description": "Shipping type provided.",
                              "items": {
                                "type": "object",
                                "properties": {
                                  "carrierMethodName": {
                                    "type": "string",
                                    "description": "Name of the shipping carrier. Carrier names can be retrieved from the Get carrier methods API."
                                  },
                                  "carrierMethodType": {
                                    "type": "string",
                                    "description": "Shipping method."
                                  }
                                },
                                "description": "Shipping type provided."
                              }
                            }
                          },
                          "description": "Shipping Details."
                        }
                      },
                      "calendarDayConfiguration": {
                        "type": "object",
                        "properties": {
                          "standardProcessingSchedule": {
                            "type": "object",
                            "properties": {
                              "sunday": {
                                "type": "object",
                                "properties": {
                                  "isWorkingDay": {
                                    "type": "boolean",
                                    "description": "Flag to specify if shipNode is operational on the specified day of each week. Allowed values are true or false."
                                  },
                                  "cutOffTime": {
                                    "type": "string",
                                    "description": "Order processing cutoff time. Please note that cutoff time is respective of the seller’s time zone. Example: '09:30'(HH:mm)",
                                    "format": "HH:mm"
                                  }
                                }
                              },
                              "monday": {
                                "type": "object",
                                "properties": {
                                  "isWorkingDay": {
                                    "type": "boolean",
                                    "description": "Flag to specify if shipNode is operational on the specified day of each week. Allowed values are true or false."
                                  },
                                  "cutOffTime": {
                                    "type": "string",
                                    "description": "Order processing cutoff time. Please note that cutoff time is respective of the seller’s time zone. Example: '09:30'(HH:mm)",
                                    "format": "HH:mm"
                                  }
                                }
                              },
                              "tuesday": {
                                "type": "object",
                                "properties": {
                                  "isWorkingDay": {
                                    "type": "boolean",
                                    "description": "Flag to specify if shipNode is operational on the specified day of each week. Allowed values are true or false."
                                  },
                                  "cutOffTime": {
                                    "type": "string",
                                    "description": "Order processing cutoff time. Please note that cutoff time is respective of the seller’s time zone. Example: '09:30'(HH:mm)",
                                    "format": "HH:mm"
                                  }
                                }
                              },
                              "wednesday": {
                                "type": "object",
                                "properties": {
                                  "isWorkingDay": {
                                    "type": "boolean",
                                    "description": "Flag to specify if shipNode is operational on the specified day of each week. Allowed values are true or false."
                                  },
                                  "cutOffTime": {
                                    "type": "string",
                                    "description": "Order processing cutoff time. Please note that cutoff time is respective of the seller’s time zone. Example: '09:30'(HH:mm)",
                                    "format": "HH:mm"
                                  }
                                }
                              },
                              "thursday": {
                                "type": "object",
                                "properties": {
                                  "isWorkingDay": {
                                    "type": "boolean",
                                    "description": "Flag to specify if shipNode is operational on the specified day of each week. Allowed values are true or false."
                                  },
                                  "cutOffTime": {
                                    "type": "string",
                                    "description": "Order processing cutoff time. Please note that cutoff time is respective of the seller’s time zone. Example: '09:30'(HH:mm)",
                                    "format": "HH:mm"
                                  }
                                }
                              },
                              "friday": {
                                "type": "object",
                                "properties": {
                                  "isWorkingDay": {
                                    "type": "boolean",
                                    "description": "Flag to specify if shipNode is operational on the specified day of each week. Allowed values are true or false."
                                  },
                                  "cutOffTime": {
                                    "type": "string",
                                    "description": "Order processing cutoff time. Please note that cutoff time is respective of the seller’s time zone. Example: '09:30'(HH:mm)",
                                    "format": "HH:mm"
                                  }
                                }
                              },
                              "saturday": {
                                "type": "object",
                                "properties": {
                                  "isWorkingDay": {
                                    "type": "boolean",
                                    "description": "Flag to specify if shipNode is operational on the specified day of each week. Allowed values are true or false."
                                  },
                                  "cutOffTime": {
                                    "type": "string",
                                    "description": "Order processing cutoff time. Please note that cutoff time is respective of the seller’s time zone. Example: '09:30'(HH:mm)",
                                    "format": "HH:mm"
                                  }
                                }
                              }
                            },
                            "description": "Operating Schedule for the fulfillment center"
                          },
                          "additionalDaysOff": {
                            "type": "array",
                            "description": "List of additional days on which the fulfillment center is closed. If there are no additional off days, then this list will be empty. Format for Date is ISO 8601. For example: '2021-07-16'(yyyy-MM-dd) ",
                            "format": "yyyy-MM-dd",
                            "items": {
                              "type": "string",
                              "description": "List of additional days on which the fulfillment center is closed. If there are no additional off days, then this list will be empty. Format for Date is ISO 8601. For example: '2021-07-16'(yyyy-MM-dd) ",
                              "format": "yyyy-MM-dd"
                            }
                          }
                        },
                        "description": "Calendar day promise details. For examples, please refer to 'Sample 2 - Calendar Day Configurations' in request & response samples."
                      }
                    }
                  }
                },
                "examples": {
                  "Sample 1": {
                    "value": [
                      {
                        "shipNode": "99351656957153281",
                        "nodeType": "3PL",
                        "shipNodeName": "MP_Deliverr",
                        "status": "INACTIVE",
                        "timeZone": "EST",
                        "distributorSupportedServices": [
                          "TWO_DAY_DELIVERY"
                        ],
                        "postalAddress": {
